import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const listEmployees = (employees) => {
  console.log(employees.data[0].name)
}

function App() {
  const [employees, setEmployees] = useState({ })

  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      setEmployees(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div className="App">

      <div>
        {employees.status === 200 ?
          <h3>{listEmployees(employees)}</h3>
          :
          <h3>LOADING</h3>
        }
      </div>
    </div>
  );
}

export default App;
